import React from "react";
import icyimg from "../../../assets/icyrueter.png"

const Icy = () => {

    const style = {
        background: {
            backgroundColor: "black",
            color: "white",
            paddingTop: "20%",
            paddingBottom: "20%",
            height: "auto",
            width: "auto"
        },
        img: {
            height: "10%"
        }
    }
    return (
        <div style={style.background}>
            <img src={icyimg} />
        </div>
    )
}

export default Icy;
